(4, 'admin', '2019-10-10 16:22:44', 'news world <br><br>', 'news world ', '', 'NEWS', 'news world    news world ', 'world ', '2', 'news', 0, 1, 1, 1, 0, 0, '', '', ''),
(5, 'admin', '2019-10-23 17:09:50', 'The Austrian national Council (lower house of Parliament) of the 27th convocation on Wednesday met for the first time in the new composition formed following the elections held in September.<br>Early parliamentary elections were held in Austria on September 29. According to the final data of the interior Ministry, the Austrian people\\\'s party (ANP) of Sebastian Kurz won with 37.5% of the vote. Austrian President Alexander van der Bellen handed Hen a mandate to form a government.<br>Wolfgang Sobotka, Chairman of the National Council, opened the first session of Parliament 24 days after the elections.', 'The Austrian national Council (lower house of Parliament) of the 27th convocation on Wednesday met for the first time in the new composition formed following the elections held in September.<br>Early parliamentary elections were held in Austria on September 29. According to the final data of the interior Ministry, the Austrian people\\\'s party (ANP) of Sebastian Kurz won with 37.5% of the vote. Austrian President Alexander van der Bellen handed Hen a mandate to form a government.<br>Wolfgang Sobotka, Chairman of the National Council, opened the first session of Parliament 24 days after the elections.', '', 'The Austrian Parliament met for the first time in the new composition after the elections', 'The Austrian national Council (lower house of Parliament) of the 27th convocation on Wednesday met for the first time in the new composition formed following the elections held in September. Early parliamentary elections were held in Austria on September 29. According to the final data of the', 'Austrian, elections, Council, Parliament, first, September, President, Alexander, Bellen, handed, mandate, Wolfgang, government, party, Sobotka, Chairman, National, opened, session, Sebastian', '2', 'the-austrian-parliament-met-for-the-first-time-in-the-new-composition-after-the-elections', 0, 1, 1, 1, 0, 0, '', '', ''),
(6, 'admin', '2019-10-23 17:11:15', 'China has so far refused to discuss with NATO the inclusion of shorter-and medium-range missiles in arms control regimes, but the Alliance will continue to raise the issue, NATO Secretary General Jens Stoltenberg said on Wednesday.<br>Speaking at a discussion at the conference on non-proliferation in Brussels, he noted that \\\"China has not violated anything\\\" by developing and deploying medium-range and shorter-range missiles, but China is becoming a significant military power, which imposes a responsibility on the country in this area.', 'China has so far refused to discuss with NATO the inclusion of shorter-and medium-range missiles in arms control regimes, but the Alliance will continue to raise the issue, NATO Secretary General Jens Stoltenberg said on Wednesday.<br>Speaking at a discussion at the conference on non-proliferation in Brussels, he noted that \\\"China has not violated anything\\\" by developing and deploying medium-range and shorter-range missiles, but China is becoming a significant military power, which imposes a responsibility on the country in this area.', '', 'China refuses to discuss INF control with NATO, Stoltenberg says', 'China has so far refused to discuss with NATO the inclusion of shorter-and medium-range missiles in arms control regimes, but the Alliance will continue to raise the issue, NATO Secretary General Jens Stoltenberg said on Wednesday. Speaking at a discussion at the conference on non-proliferation in', 'range, China, shorter, medium, missiles, becoming, noted, violated, anything, developing, deploying, power, significant, military, proliferation, which, imposes, responsibility, Brussels, Speaking', '2', 'china-refuses-to-discuss-inf-control-with-nato-stoltenberg-says', 0, 1, 1, 1, 0, 0, '', '', ''),
(7, 'admin', '2019-10-24 10:44:42', 'Chelsea won against Ajax (1-0) in the away leg of the Champions League.<br><br>London scored six points in three rounds of the group stage, losing at the start of Valencia (0: 1) and then beating Lille (2:1).<br><br>Chelsea are six points ahead of Ajax and top of group H.<br><br>Valencia scored 4 points, Lille 1 point.', 'Chelsea won against Ajax (1-0) in the away leg of the Champions League.<br><br>London scored six points in three rounds of the group stage, losing at the start of Valencia (0: 1) and then beating Lille (2:1).<br><br>Chelsea are six points ahead of Ajax and top of group H.<br><br>Valencia scored 4 points, Lille 1 point.', '', 'Chelsea and Ajax share the top spot in the Champions League group after three rounds', 'Chelsea won against Ajax (1-0) in the away leg of the Champions League.  London scored six points in three rounds of the group stage, losing at the start of Valencia (0: 1) and then beating Lille (2:1).  Chelsea are six points ahead of Ajax and top of group H.  Valencia scored 4 points, Lille 1', 'points, Chelsea, Lille, Valencia, group, scored, London, three, rounds, against, stage, losing, start, League, beating, Champions, ahead, point', '6', 'chelsea-and-ajax-share-the-top-spot-in-the-champions-league-group-after-three-rounds', 0, 1, 1, 1, 0, 0, '', '', ''),
(8, 'admin', '2019-10-24 10:46:37', 'UEFA has named four contenders for the title of the best player of the 3rd round of the group stage of the Champions League.<br><br>Liverpool midfielder Alex Oxlade-Chamberlain scored two goals against Genk (4-1).<br><br>Juventus forward Paulo dybala scored a double against Lokomotiv (2-1).<br><br>Midfielder Raheem sterling participated in all the goals of Manchester city in the meeting with \\\"Atalanta\\\" (5:1). He scored three goals, gave an effective pass and earned a penalty.<br><br>PSG striker Kylian Mbappe scored a hat-trick and made an assist against Brugge (5-0).', 'UEFA has named four contenders for the title of the best player of the 3rd round of the group stage of the Champions League.<br><br>Liverpool midfielder Alex Oxlade-Chamberlain scored two goals against Genk (4-1).<br><br>Juventus forward Paulo dybala scored a double against Lokomotiv (2-1).<br><br>Midfielder Raheem sterling participated in all the goals of Manchester city in the meeting with \\\"Atalanta\\\" (5:1). He scored three goals, gave an effective pass and earned a penalty.<br><br>PSG striker Kylian Mbappe scored a hat-trick and made an assist against Brugge (5-0).', '', 'Dibala, Mbappe, sterling contenders for the title of player of the week in the Champions League', 'UEFA has named four contenders for the title of the best player of the 3rd round of the group stage of the Champions League.  Liverpool midfielder Alex Oxlade-Chamberlain scored two goals against Genk (4-1).  Juventus forward Paulo dybala scored a double against Lokomotiv (2-1).  Midfielder Raheem', 'scored, goals, against, named, Atalanta, sterling, participated, Manchester, meeting, three, Midfielder, effective, earned, penalty, striker, Kylian, Mbappe, trick, assist, Raheem', '0', 'dibala-mbappe-sterling-contenders-for-the-title-of-player-of-the-week-in-the-champions-league', 0, 1, 1, 1, 0, 0, '', '', ''),
(9, 'admin', '2019-10-24 11:15:07', 'The price of December Brent crude futures exceeded $61 for the first time since September 30, according to data from the LONDON ice exchange.\n\nThe growth amounted to nearly 2.26 percent as of 22:45 GMT. The price per barrel rose to $61.1.\n\nThe last time oil prices exceeded the $61 mark on September 30. Then at the maximum they were worth $62.24.', 'The price of December Brent crude futures exceeded $61 for the first time since September 30, according to data from the LONDON ice exchange.\n\nThe growth amounted to nearly 2.26 percent as of 22:45 GMT. The price per barrel rose to $61.1.\n\nThe last time oil prices exceeded the $61 mark on September 30. Then at the maximum they were worth $62.24.', '', 'The price of oil exceeded $61 for the first time in almost a month', '', '', '3', 'the-price-of-oil-exceeded-61-for-the-first-time-in-almost-a-month', 0, 1, 1, 1, 0, 0, '', '', ''),
(10, 'admin', '2019-10-24 11:18:05', 'Experts surveyed by the Agency note that investors are tired of fearing political risks and during the next recession, emerging markets will have big problems', 'Experts surveyed by the Agency note that investors are tired of fearing political risks and during the next recession, emerging markets will have big problems Indices of stocks, bonds and currencies of emerging markets are near highs, but the situation is far from brilliant, Bloomberg warns. According to the Agency\\\'s forecast, it is high-yield emerging markets (EM, emerging markets) that could become a new bubble threatened by political crises in Ecuador, Chile, Lebanon and other countries.', '', 'Bloomberg warned of a bubble in the market for investment in developing countries', '', '', '3', 'bloomberg-warned-of-a-bubble-in-the-market-for-investment-in-developing-countries', 0, 1, 1, 1, 0, 0, '', '', ''),
(11, 'admin', '2019-10-27 13:02:06', 'Международная правозащитная организация «Репортеры без границ» потребовала от правительства Бурунди освободить четверых журналистов газеты «Иваку», арестованных сотрудниками органов безопасности вблизи границы с ДРК в начале этой недели.\n\nПо информации новостного агентства RFI Kiswahili, журналисты были арестованы вместе с их водителем в провинции Бубанза.', 'Международная правозащитная организация «Репортеры без границ» потребовала от правительства Бурунди освободить четверых журналистов газеты «Иваку», арестованных сотрудниками органов безопасности вблизи границы с ДРК в начале этой недели.\n\nПо информации новостного агентства RFI Kiswahili, журналисты были арестованы вместе с их водителем в провинции Бубанза.', '', 'Reporters without borders demands release of Burundian journalists', '', '', '2', 'reporters-without-borders-demands-release-of-burundian-journalists', 0, 1, 1, 1, 0, 0, '', '', ''),
(12, 'admin', '2019-10-27 13:04:03', 'At 8:00 local time, presidential and parliamentary elections started in Argentine. This is reported by the Cuban Agency Prensa Latina. More than 33.8 million citizens registered to vote.', 'Interior Minister Rogelio Frigerio assured that the elections scheduled to be held in the atmosphere of \\\"peace and fairness\\\". The day before, on 26 October, additional contingents of the armed forces were deployed in a number of border areas to ensure the security of the electoral process.', '', 'Parliamentary and presidential elections have started in Argentina', 'At 8:00 local time, presidential and parliamentary elections started in Argentine. This is reported by the Cuban Agency Prensa Latina. More than 33.8 million citizens registered to vote. Interior Minister Rogelio Frigerio assured that the elections scheduled to be held in the atmosphere of peace', 'elections, local, forces, fairness, before, October, additional, contingents, armed, deployed, atmosphere, number, border, areas, ensure, security, electoral, peace, assured, scheduled', '2', 'parliamentary-and-presidential-elections-have-started-in-argentina', 0, 1, 1, 1, 0, 0, '', '', ''),
